import { assert } from "node:console";
import { findRepeatedDnaSequences } from "../../../../src/leetcode/2026/feb/14-task/15-feb-2025-task_14";
import test, { expect } from "@playwright/test";

test.describe("Repeated DNA Sequences", async () => {
  test("case 1", async () => {
    expect(
      findRepeatedDnaSequences("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"),
    ).toEqual(["AAAAACCCCC", "CCCCCAAAAA"]);
  });

  test("case 2", async () => {
    expect(findRepeatedDnaSequences("AAAAAAAAAAAAA")).toEqual(["AAAAAAAAAA"]);
  });
  test("case 3", async () => {
    expect(findRepeatedDnaSequences("CAAAAAAAAAC")).toEqual([]);
  });
  test("case 4", async () => {
    expect(findRepeatedDnaSequences("")).toEqual([]);
  });
});
